    [],nt"revision_timestamp": "2016-07-27T23:02:41.261226",nt"name": "reindeer-breeding-along-the-finno-ugric-tribes",nt"isopen":
    false,nt"url": null,nt"notes": "This paper discusses the reindeer breeding
    practices among the Finno-Urgic tribes located in the northern territories of the
    Soviet Union and frontier districts between Europe and Asia. Details on the reindeer
    breeding area, the reindeer herders' living quarters and clothing, the reindeer
    pastures, and the improvement of stock are provided. Information on the total reindeer
    stock in the Soviet Union, calving, preservation rates, production of reindeer meat
    per reindeer herder, and the marking of reindeer is also included. The paper also
    discusses herding, the destruction of reindeer pests, slaughtering and use and preparation
    of products, schools and courses for reindeer herders and experts, and development
    and research work.",nt"license_title": "License Not Specified",nt"extras":
